export class session{
    isSessionSelected : boolean;
    sessionId : string;
    sessionName : string;
    sessionTime : []

    constructor (){
        this.isSessionSelected = false;
        this.sessionId  = "";
        this.sessionName ="";
        this.sessionTime = [];
    }

    static getAllSessions(): session[] {
        return [
          { sessionId: '0', sessionName: 'Session 1', sessionTime: [""], isSessionSelected: false },
          { sessionId: '1', sessionName: 'Sesison 2', sessionTime: '10', isSessionSelected: false },
          { sessionId: '2', sessionName: 'Session 3', sessionTime: '11', isSessionSelected: false },
        ];
      }

}
